/**
 * @file 设置剪贴板
 * @module data
 * @author wangyongqing <wangyongqing01@baidu.com>
 */
import {invokeP} from '../invoke';
/**
 * @function setClipboard
 * @param {string} text - 复制到剪贴板的文案
 */
export default function setClipboard(text) {
    return invokeP('v19/utils/setClipboardData', {
        params: {
            data: text
        }
    });
}
